import React from 'react';
import '../../App.css';
import HeroSection from '../HeroSection';
import Footer from '../Footer';

function BoM() {
  return (
    <>
      <HeroSection />
      <Footer />
      <h4> Buyer order management</h4>
    </>
  );
}

export default BoM;
